import logo from './logo.svg';
import './App.css';
import pokemons from './pokemons.json';
import Pokemon from './Pokemon.jsx';

function App() {
  return (
    <div className="App">
      {pokemons.map((poke)=> <Pokemon key={poke.id} name={poke.name.english} 
                              type={poke.type} image={poke.image.thumbnail} base={poke.base}/>)}

    </div>
  );
}

export default App;
